CREATE SCHEMA OdinPartsDB DEFAULT CHARSET UTF8;

CREATE TABLE IF NOT EXISTS UTENTE(
	`username` VARCHAR(20) PRIMARY KEY NOT NULL,
    `nome` VARCHAR(40) NOT NULL,
    `cognome` VARCHAR(40) NOT NULL,
    `mail` VARCHAR(30) NOT NULL,
    `password` VARCHAR(20) NOT NULL,
    `voto_sped` DECIMAL(4,2) DEFAULT 0 NOT NULL,
    `voto_comm` DECIMAL(4,2) DEFAULT 0 NOT NULL,
    `voto_desc` DECIMAL(4,2) DEFAULT 0 NOT NULL,
    CHECK (`voto_sped` BETWEEN 0.0 AND 10.0),
    CHECK (`voto_desc` BETWEEN 0.0 AND 10.0),
    CHECK (`voto_comm` BETWEEN 0.0 AND 10.0),
    `voto` DECIMAL(4,2) AS ((voto_comm+voto_sped+voto_desc)/3),
    `feedback_n` INT DEFAULT 0 NOT NULL,
    `registrato` DATE NOT NULL
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS INDIRIZZO(
	`via` VARCHAR(30) NOT NULL,
    `civico` INT NOT NULL,
    `città` VARCHAR(20) NOT NULL,
    `CAP` INT NOT NULL,
    `stato` VARCHAR(20) NOT NULL,
    `username` VARCHAR(20) NOT NULL,
    PRIMARY KEY (`username`,`via`,`civico`,`città`,`CAP`,`stato`),
    CONSTRAINT usrn_fk
		FOREIGN KEY(`username`) REFERENCES UTENTE(`username`)
    	    ON DELETE CASCADE				/*Se l'utente viene cancellato, i suoi indirizzi vengono eliminati*/
       		ON UPDATE CASCADE				/*Se l'utente modifica il suo username, il cambiamento si riflette qui*/		
)ENGINE=InnoDB DEFAULT CHARSET=utf8; 

CREATE TABLE IF NOT EXISTS RICAMBIO(
	`id_ricambio` VARCHAR(20) PRIMARY KEY NOT NULL,
    `nome` VARCHAR(60) NOT NULL,
    `produttore` VARCHAR(20) NOT NULL,
    `categoria` VARCHAR(60) NOT NULL,
    `n_seriale` VARCHAR(20) NOT NULL,
    `giacenza` INT NOT NULL,
    `descrizione` VARCHAR(700) NOT NULL,
    `fascia` VARCHAR(12) NOT NULL,
    `dimensioni` VARCHAR(20) NOT NULL,
    `materiale` VARCHAR(30) NOT NULL,
    `prezzo` DECIMAL(8,2) NOT NULL,
    `url_foto` VARCHAR(2083) NOT NULL
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
CREATE TABLE IF NOT EXISTS MODELLO_AUTO(
	`auto_id` VARCHAR(30) PRIMARY KEY NOT NULL,
    `casa_prod` VARCHAR(15) NOT NULL,
    `anno` VARCHAR(10) NOT NULL,
    `versione` VARCHAR(8),
    `carburante` VARCHAR(10) NOT NULL,
    `motore` VARCHAR(3) NOT NULL,
    `cilindrata` SMALLINT NOT NULL
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
CREATE TABLE IF NOT EXISTS ORDINE(
	`id_ordine` INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
    `acquirente` VARCHAR(20) NOT NULL,
    `carta` CHAR(16) NOT NULL,
    `data_pay` TIMESTAMP NOT NULL,
    `totale` DECIMAL(6,2) NOT NULL,
    CONSTRAINT order_fk
    	FOREIGN KEY(`acquirente`) REFERENCES UTENTE(`username`)

     	   ON UPDATE CASCADE		/*Se l'username viene modificato, il cambiamento si riflette*/
 )ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=0;

CREATE TABLE IF NOT EXISTS RECENSIONE(
	`commento` VARCHAR(1000) NOT NULL,
    `data` TIMESTAMP NOT NULL,
    `votazione` INT NOT NULL,
    `username` VARCHAR(20) NOT NULL,
    `id_ricambio` VARCHAR(20) NOT NULL,
    CHECK (`votazione` BETWEEN 0 AND 10),
    PRIMARY KEY(`username`,`id_ricambio`),
    CONSTRAINT rev_fk_0
    	FOREIGN KEY (`username`) REFERENCES UTENTE(`username`)
        	ON UPDATE CASCADE,			
	CONSTRAINT rev_fk_1
    	FOREIGN KEY (`id_ricambio`) REFERENCES RICAMBIO(`id_ricambio`)
			ON DELETE CASCADE
       		ON UPDATE CASCADE		
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
CREATE TABLE IF NOT EXISTS CARTA_C(
	`numero` CHAR(16) PRIMARY KEY NOT NULL,
    `nome_titolare` VARCHAR(20) NOT NULL,
    `cognome_titolare` VARCHAR(20) NOT NULL,
    `cvv` CHAR(3) NOT NULL,
    `scadenza` CHAR(6) NOT NULL,
    `username` VARCHAR(20) NOT NULL,
    CONSTRAINT card_c
		FOREIGN KEY(`username`) REFERENCES UTENTE(`username`)
			ON DELETE CASCADE			/*Se l'utente è cancellato, le informazioni della carta non sono rilevanti*/
			ON UPDATE CASCADE			/*Se l'utente modifica il suo username, il cambiamento si riflette qui*/
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
CREATE TABLE IF NOT EXISTS SPEDIZIONE(
	`id_sped` VARCHAR(15) PRIMARY KEY NOT NULL,
    `corriere` VARCHAR(20) NOT NULL,
    `data_invio` DATE NOT NULL,
    `data_consegna` DATE NOT NULL,
    `id_ordine` INT NOT NULL,
    CONSTRAINT shpmt_fk
		FOREIGN KEY(`id_ordine`) REFERENCES ORDINE(`id_ordine`)
			ON DELETE CASCADE			/*Se l'ordine è cancellato, frega niente della spedizione*/
        	ON UPDATE CASCADE			
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS LISTA_COMP(
	`auto_id`	VARCHAR(30) NOT NULL,
    `id_ricambio` VARCHAR(20) NOT NULL,
    PRIMARY KEY(`auto_id`,`id_ricambio`),
	CONSTRAINT list_c_0
		FOREIGN KEY(`auto_id`) REFERENCES MODELLO_AUTO(`auto_id`)
			ON DELETE CASCADE
            ON UPDATE CASCADE,
	CONSTRAINT list_c_1
		FOREIGN KEY(`id_ricambio`) REFERENCES RICAMBIO(`id_ricambio`)
			ON DELETE CASCADE
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS ACQUISTATI(
	`acquirente` VARCHAR(20) NOT NULL,
    `id_ricambio` VARCHAR(20) NOT NULL,
    `qta` INT NOT NULL,
    PRIMARY KEY(`acquirente`,`id_ricambio`),
    CONSTRAINT acquisti_c_0
		FOREIGN KEY(`acquirente`) REFERENCES UTENTE(`username`)
            ON UPDATE CASCADE,
	CONSTRAINT acquisti_c_1
		FOREIGN KEY(`id_ricambio`) REFERENCES RICAMBIO(`id_ricambio`)
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS VENDUTI(
	`venditore`VARCHAR(20) NOT NULL,
    `id_ricambio` VARCHAR(20) NOT NULL,
    `qta` INT NOT NULL,
    PRIMARY KEY(`venditore`,`id_ricambio`),
	CONSTRAINT venduti_c_0
		FOREIGN KEY(`venditore`) REFERENCES UTENTE(`username`)
			ON DELETE CASCADE
            ON UPDATE CASCADE,
	CONSTRAINT venduti_c_1	
		FOREIGN KEY(`id_ricambio`) REFERENCES RICAMBIO(`id_ricambio`)
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS VENDITE(
	`venditore`VARCHAR(20) NOT NULL,
    `id_ordine` INT NOT NULL,
    PRIMARY KEY(`venditore`,`id_ordine`),
    CONSTRAINT vendite_c_0
		FOREIGN KEY(`venditore`) REFERENCES UTENTE(`username`)
			ON DELETE CASCADE
            ON UPDATE CASCADE,
	CONSTRAINT vendite_c_1
		FOREIGN KEY(`id_ordine`) REFERENCES ORDINE(`id_ordine`)
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS VOTI(
	`acquirente` VARCHAR(20) NOT NULL,
	`venditore` VARCHAR(20) NOT NULL,
	`feedback` VARCHAR(80) NOT NULL,
    PRIMARY KEY(`acquirente`,`venditore`),
    CONSTRAINT feedback_c_0
		FOREIGN KEY(`acquirente`) REFERENCES UTENTE(`username`)
            ON UPDATE CASCADE,
	CONSTRAINT feedback_c_1
		FOREIGN KEY(`venditore`) REFERENCES UTENTE(`username`)
			ON DELETE CASCADE
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS RIC_ORD(
	`id_ordine` INT NOT NULL,
    `id_ricambio` VARCHAR(20) NOT NULL,
    `qta` INT NOT NULL,
    PRIMARY KEY(`id_ordine`,`id_ricambio`),
    CONSTRAINT ric_ord_0
		FOREIGN KEY(`id_ordine`) REFERENCES ORDINE(`id_ordine`)
			ON DELETE CASCADE
            ON UPDATE CASCADE,
	CONSTRAINT ric_ord_1
		FOREIGN KEY(`id_ricambio`) REFERENCES RICAMBIO(`id_ricambio`)
			ON DELETE CASCADE
            ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;








